import React, { useEffect, useState } from "react";
import api from "../services/api";
import {
  Box,
  Typography,
  CircularProgress,
  Paper,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  MenuItem,
  Select,
  FormControl,
  InputLabel,
} from "@mui/material";
import DownloadIcon from "@mui/icons-material/Download";

const DeploymentCalendarPage = () => {
  const [deploymentRequests, setDeploymentRequests] = useState([]);
  const [deploymentSupports, setDeploymentSupports] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedEvent, setSelectedEvent] = useState(null);
  const [openDialog, setOpenDialog] = useState(false);
  const [statuses] = useState(["null", "success", "redeploy", "cancel"]);
  const [sqiPics, setSqiPics] = useState([]);
  const [selectedStatus, setSelectedStatus] = useState("");
  const [selectedPic, setSelectedPic] = useState("");
  const [isUpdating, setIsUpdating] = useState(false);

  const role = "SQI";

  const handleCardClick = (item, type) => {
    console.log("üü° [CLICK] Event selected:", item, "Type:", type); // üß© LOG
    setSelectedEvent({ ...item, type });
    setSelectedStatus(item.status || "null");
    setSelectedPic(item.sqiPicId || "");
    setOpenDialog(true);
  };

  const fetchDeploymentRequests = async () => {
    try {
      const res = await api.get("/deployment-requests");
      console.log("‚úÖ [API] Deployment Requests:", res.data); // üß© LOG
      setDeploymentRequests(res.data?.data || res.data || []);
    } catch (err) {
      console.error("‚ùå Gagal mengambil deployment requests:", err);
      setDeploymentRequests([]);
    }
  };

  const fetchDeploymentSupports = async () => {
    try {
      const res = await api.get("/deployment-supports");
      console.log("‚úÖ [API] Deployment Supports:", res.data); // üß© LOG
      setDeploymentSupports(res.data?.data || res.data || []);
    } catch (err) {
      console.error("‚ùå Gagal mengambil deployment supports:", err);
      setDeploymentSupports([]);
    }
  };

  useEffect(() => {
    const loadData = async () => {
      console.log("üîµ [LOAD] Fetching all data..."); // üß© LOG
      setLoading(true);
      await Promise.all([fetchDeploymentRequests(), fetchDeploymentSupports()]);
      setLoading(false);
      console.log("üü¢ [LOAD DONE] Requests:", deploymentRequests.length, "Supports:", deploymentSupports.length); // üß© LOG
    };

    const fetchSqiPics = async () => {
      try {
        const res = await api.get("/sqi-pics");
        console.log("‚úÖ [API] SQI PICs:", res.data); // üß© LOG
        setSqiPics(res.data?.data || res.data || []);
      } catch (err) {
        console.error("‚ùå Gagal mengambil data SQI PIC:", err);
      }
    };

    loadData();
    if (role === "SQI") fetchSqiPics();
  }, []);

  useEffect(() => {
    console.log("üß© [STATE] Deployment Requests:", deploymentRequests); // üß© LOG
    console.log("üß© [STATE] Deployment Supports:", deploymentSupports); // üß© LOG
  }, [deploymentRequests, deploymentSupports]);

  const handleDownload = async () => {
    try {
      if (!selectedEvent?.attachment) {
        console.warn("‚ö†Ô∏è Tidak ada attachment untuk diunduh."); // üß© LOG
        return;
      }
      const filename = selectedEvent.attachment.split("/").pop();
      console.log("‚¨áÔ∏è [DOWNLOAD] File:", filename); // üß© LOG
      const response = await api.get(
        `/deployment-${selectedEvent.type === "support" ? "supports" : "requests"}/download/${filename}`,
        { responseType: "blob" }
      );
      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", filename);
      document.body.appendChild(link);
      link.click();
      link.remove();
    } catch (err) {
      console.error("‚ùå Gagal mengunduh file:", err);
      alert("Gagal mengunduh file.");
    }
  };

  const handleStatusChange = async (event) => {
    if (isUpdating) return;
    setIsUpdating(true);
    const newStatus = event.target.value;
    console.log("üü† [UPDATE STATUS] New status:", newStatus); // üß© LOG
    setSelectedStatus(newStatus);

    try {
      const endpoint =
        selectedEvent.type === "support"
          ? `/deployment-supports/${selectedEvent.id}`
          : `/deployment-requests/${selectedEvent.id}`;

      console.log("üì° PATCH Endpoint:", endpoint); // üß© LOG
      await api.patch(endpoint, {
        status: newStatus === "null" ? null : newStatus,
      });
      await Promise.all([fetchDeploymentRequests(), fetchDeploymentSupports()]);
      alert("Status berhasil diperbarui!");
    } catch (err) {
      console.error("‚ùå Gagal memperbarui status:", err);
      alert("Gagal memperbarui status.");
    } finally {
      setIsUpdating(false);
    }
  };

  const handleAssignPic = async (event) => {
    if (isUpdating) return;
    setIsUpdating(true);
    const picId = event.target.value;
    console.log("üü¢ [ASSIGN PIC] PIC ID:", picId); // üß© LOG
    setSelectedPic(picId);

    try {
      const endpoint =
        selectedEvent.type === "support"
          ? `/deployment-supports/${selectedEvent.id}`
          : `/deployment-requests/${selectedEvent.id}`;
      console.log("üì° PATCH Endpoint:", endpoint); // üß© LOG
      await api.patch(endpoint, {
        sqiPicId: picId === "" ? null : picId,
      });
      await Promise.all([fetchDeploymentRequests(), fetchDeploymentSupports()]);
      alert("PIC berhasil di-assign!");
    } catch (err) {
      console.error("‚ùå Gagal assign PIC:", err);
      alert("Gagal assign PIC.");
    } finally {
      setIsUpdating(false);
    }
  };

  const getColor = (riskImpact) => {
    switch (riskImpact) {
      case "Low":
        return "#A5D6A7";
      case "Medium":
        return "#FFF59D";
      case "High":
        return "#EF9A9A";
      case "Major Release":
        return "#3a3a3aff";
      default:
        return "#E0E0E0";
    }
  };

  // üîÑ Group per hari
  const days = ["Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday", "Sunday"];
  const groupedData = days.map((day) => {
    const requests = deploymentRequests.filter(
      (r) => new Date(r.implementDate).toLocaleDateString("en-US", { weekday: "long" }) === day
    );
    const supports = deploymentSupports.filter(
      (s) => new Date(s.implementDate).toLocaleDateString("en-US", { weekday: "long" }) === day
    );
    console.log(`üìÖ [GROUP] ${day} => Requests: ${requests.length}, Supports: ${supports.length}`); // üß© LOG
    return { day, requests, supports };
  });

  if (loading) {
    console.log("‚è≥ [LOADING] Menunggu data..."); // üß© LOG
    return (
      <Box sx={{ display: "flex", justifyContent: "center", alignItems: "center", minHeight: "100vh", marginLeft: "220px" }}>
        <CircularProgress size={50} />
      </Box>
    );
  }

  console.log("‚úÖ [RENDER] Rendering calendar view..."); // üß© LOG

  return (
    <Box sx={{ display: "flex", overflowX: "auto", height: "100vh", p: 3, ml: "220px", gap: 2 }}>
      {groupedData.map(({ day, requests, supports }) => (
        <Paper key={day} elevation={4} sx={{ minWidth: 400, flexShrink: 0, borderRadius: 2, p: 2 }}>
          <Typography variant="h6" align="center" sx={{ mb: 2, color: "#1976d2", fontWeight: "bold" }}>
            {day}
          </Typography>

          <Box sx={{ display: "flex", gap: 1 }}>
            {/* Deployment Requests */}
            <Box sx={{ flex: 1 }}>
              <Typography variant="subtitle2" align="center" sx={{ mb: 1, color: "#2e7d32" }}>
                Deployment Request
              </Typography>
              {requests.length > 0 ? (
                requests.map((req) => (
                  <Paper
                    key={req.id}
                    sx={{
                      backgroundColor: getColor(req.riskImpact),
                      p: 1,
                      mb: 1,
                      borderRadius: 1.5,
                      cursor: "pointer",
                      textAlign: "center",
                      "&:hover": { transform: "scale(1.03)" },
                      transition: "0.15s",
                    }}
                    onClick={() => handleCardClick(req, "request")}
                  >
                    {req.title || "(No Title)"}
                  </Paper>
                ))
              ) : (
                <Typography variant="body2" align="center" sx={{ color: "#9e9e9e" }}>
                  No requests
                </Typography>
              )}
            </Box>

            {/* Deployment Supports */}
            <Box sx={{ flex: 1 }}>
              <Typography variant="subtitle2" align="center" sx={{ mb: 1, color: "#1565c0" }}>
                Deployment Support
              </Typography>
              {supports.length > 0 ? (
                supports.map((sup) => (
                  <Paper
                    key={sup.id}
                    sx={{
                      backgroundColor: "#e3f2fd",
                      p: 1,
                      mb: 1,
                      borderRadius: 1.5,
                      cursor: "pointer",
                      textAlign: "center",
                      "&:hover": { transform: "scale(1.03)" },
                      transition: "0.15s",
                    }}
                    onClick={() => handleCardClick(sup, "support")}
                  >
                    {sup.title || "(No Title)"}
                  </Paper>
                ))
              ) : (
                <Typography variant="body2" align="center" sx={{ color: "#9e9e9e" }}>
                  No supports
                </Typography>
              )}
            </Box>
          </Box>
        </Paper>
      ))}
    </Box>
  );
};

export default DeploymentCalendarPage;
